package com.server.base;

import com.server.base.common.dto.PagingDto;
import com.server.base.repository.dto.CategoryDto;
import com.server.base.repository.dto.CategorySubDto;
import org.junit.jupiter.api.Test;

public class CategoryTest extends BaseTest{

    @Test
    void saveMain(){
        CategoryDto categoryDto = new CategoryDto();
        categoryDto.setCategoryNo(4L);
        categoryDto.setCategory_etc1("쇼핑");
        categoryDto.setIsIncome(false);
        categoryDto.setCategoryImage("data:image/png;base64,");
        post("/category/main", categoryDto);
    }
    @Test
    void removeMain(){
        CategoryDto categoryDto = new CategoryDto();
        categoryDto.setCategoryNo(3L);
        categoryDto.setCategory_etc2_list(null);
        delete("/category/main/3", categoryDto);
    }
    @Test
    void saveSub(){
        CategorySubDto categorySubDto = new CategorySubDto();
        categorySubDto.setCategoryNo(4L);
        categorySubDto.setCategory_etc2("옷");
        post("/category/sub", categorySubDto);
    }
    @Test
    void removeSub(){
        CategorySubDto categorySubDto = new CategorySubDto();
        categorySubDto.setCategorySubNo(2L);
        delete("/category/sub/2", categorySubDto);
    }
    @Test
    void fetchMains(){
        PagingDto pagingDto = new PagingDto();
        pagingDto.setPage(1);
        pagingDto.setLimit(2);
        get("/category/mains", pagingDto);
    }
    @Test
    void fetchSubs(){
        CategoryDto categoryDto = new CategoryDto();
        categoryDto.setCategoryNo(4L);
        get("/category/subs", categoryDto);
    }
}
